My Sisters Hot Friend - Ash Hollywood 


Actors: Ash Hollywood, Bill Bailey

Release Date: December 02, 2010

Who: Friend, Sister's Friend,

Where: Couch, Floor, Hallway, Living room,

Bill is leaving for his big DJ gig when his kid sister's friend Ash shows up at his door. She wants to get on the guest list, but bill wants no part of it. The last time she got him in trouble for banging her boyfriend at the club. She tells him that the boyfriend is gone, and she wants to be on the list......by any means necessary
